HEY HEY IT&amp;#039;S ESTHER BLUEBURGER - a smart, rueful and dead-on portrait of life&amp;#039;s unending quest to fit in; and the girl who solves it by completely breaking out - introduces a feisty outsider hero unlike any other seen on screen. Esther Blueburger&amp;#039;s (DANIELLE CANTANZARITI) quest begins when she escapes from her Bat Mitzvah party and is befriended by Sunni.. (KEISHA CASTLE-HUGHES), the effortlessly cool girl who is everything Esther thinks she wants to be. With the help of Sunni, Esther goes AWOL from her ordinary life and leaves behind her malfunctioning Jewish family to hang out with Sunni&amp;#039;s far breezier and super-hip single mom Mary (TONI COLLETTE) and attend Sunni&amp;#039;s forbidden public school as a Swedish exchange student.
